        function updateInput(medWhiteParameter, sliderValue) {
            document.getElementById("slider-input").value = sliderValue;
            fetch('http://localhost:5000/calculate', {
                method: "POST",
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify({
                    "medWhiteValue": medWhiteParameter,
                    "sliderValue": parseInt(sliderValue)
                })
            })
                .then(res => res.json())
                .then(data => alert(data))
                .catch(err => console.error(err))
        }
